import { useAuth0 } from "@auth0/auth0-react";

function Profile() {
  const { user, isAuthenticated } = useAuth0();

  const userId = user.sub;
  return (
    <div>

      {isAuthenticated ? (
        <>
        <h1>Bienvenido, {user.name}!</h1>
        <h2>Mis compras</h2>
        </>
      ) : (
        <h1>Por favor ingresa para ver tus compras.</h1>
      )}
    </div>
  );

}

export default Profile;
